import React from 'react'

export const NavBar = () => {

  return (

    <div className = 'homeOption'>

        <a className = 'homeOptionsStyle myRutes' href='/home'> Mis rutas </a>

        <a className = 'homeOptionsStyle newRute' href='/newRute'> Agregar nueva ruta </a>

        <a className = 'homeOptionsStyle completed' href='/completed'> Rutas completadas </a>

        <a className = 'homeOptionsStyle trash'> Papelera </a>
   
    </div>

  )
}
